import insta from '../img/ins.svg';
import twitter from '../img/twi.svg';
import face from '../img/fb.svg';
import whats from '../img/whats.svg';

function Footer() {
    return (
        <div id='footer'>
            <img src={insta} alt="logo insta" />
            <p>@magazine90</p>
            <img src={twitter} alt="logo twitter" />
            <p>@magazine90</p>
            <img src={face} alt="logo facebook" />
            <p>@magazine90</p>
            <img src={whats}  alt="logo whatsapp"/>
            <p>+55 (11) 99999-9999</p>
        </div>
    )
}

export default Footer;
